import React from 'react';
import { Grid, Paper, TextField, Button, Typography, Checkbox, Link, Box } from '@mui/material';

function SignUp() {
  return (
    <Grid container style={{ minHeight: '100vh' }}>
      <Grid item xs={12} md={6}>
        {/* Left Section */}
      </Grid>
    {/* Right Section */}
    <Grid item xs={12} md={6} style={{ backgroundColor: '#FFFFFF' }}>
        <Box
          display="flex"
          justifyContent="center"
          alignItems="center"
          height="100%"
        >
          <img src="sign-in.png" alt="Invoice illustration" style={{ width: '80%', height: 'auto' }} />
        </Box>
      </Grid>
    </Grid>
  );
}

export default SignUp;
